(function () {
    'use strict';

    angular
        .module("itsyouonlineApp")
        .service("ContractService", ContractService);

    ContractService.$inject = ['$http', '$q'];

    function ContractService($http, $q) {
        var apiURL = 'api';
        var GET = $http.get,
            POST = $http.post,
            PUT = $http.put,
            DELETE = $http.delete;
        return {
            list: list,
            createContract: createContract,
            updateContract: updateContract,
            deleteContract: deleteContract,
            signContract: signContract
        };

        function list(type, typeData) {
            // todo: remove
            return $q.resolve({
                data: [
                    {
                        parties: [{
                            type: 'organizations',
                            name: 'Test organization'
                        }, {
                            type: 'user',
                            name: 'lucas'
                        }],
                        content: {
                            mimeType: 'image/jpeg',
                            content: ''
                        },
                        contractType: 'Testing contract',
                        invalidates: ['dfasdffdiuyf897d6fas986dasf7asdf6dfsuijsdhdf'],
                        extends: [],
                        expires: new Date(),
                        contractId: '31654984a9sdf4q9we8r49saf798rt7jhkui98tghndf4cg6x',
                        signatures: []
                    },
                    {
                        parties: [{
                            type: 'organizations',
                            name: 'org'
                        }, {
                            type: 'user',
                            name: 'test'
                        }],
                        content: {
                            mimeType: 'text/plain',
                            content: 'Very confidential contract'
                        },
                        contractType: 'Second contract',
                        invalidates: [],
                        extends: [],
                        expires: new Date(),
                        contractId: 'dfasdffdiuyf897d6fas986dasf7asdf6dfsuijsdhdf',
                        signatures: []
                    }
                ]
            });
            var url = apiURL + '/' + type + '/' + typeData + '/contracts';
            return GET(url);
        }

        function createContract(type, typeData, contract) {
            var url = apiURL + '/' + type + '/' + typeData + '/contracts';
            return POST(url, contract);
        }

        function updateContract(type, typeData, contract) {
            var url = apiURL + '/' + type + '/' + typeData + '/contracts/' + contract.contractId;
            return PUT(url, contract);
        }

        function deleteContract(contractId) {
            var url = apiURL + '/contracts/' + contractId;
            return DELETE(url, contractId);
        }

        function signContract(contractId, username) {
            var url = apiURL + '/contracts/' + contractId;
            var data = {
                signedBy: username,
                date: new Date()
            };
            return POST(url, data);
        }
    }
})();